import obj1 from "./objects";
import ExpandableContent from "./ExpandableContent";
function ViewResource() {
  return (
    <>
      <h1 style={{ textAlign: "center" }}>Resources</h1>
      {Object.keys(obj1).map((p) => (
        <div>
          {console.log(p)}
          {/* <ExpandableContent title={p}>
            {Object.keys(obj1[p]).map((n) => (
              <ul>
                <li>
                  <ExpandableContent title={n}>
                    <ul>
                      {console.log(n, obj1[p][n])}
                      {obj1[p][n].map((k) => (
                        <li>{k}</li>
                      ))}
                    </ul>
                  </ExpandableContent>
                </li>
              </ul>
            ))}
          </ExpandableContent> */}
          <div class="accordion" id="accordionExample">
            <div class="accordion-item">
              <h2 class="accordion-header" id="headingOne">
                <button
                  class="accordion-button collapsed"
                  type="button"
                  data-bs-toggle="collapse"
                  data-bs-target="#collapseOne"
                  aria-expanded="false"
                  aria-controls="collapseOne"
                  // onClick={() => setExpanded(!expanded)}
                >
                  {title}
                </button>
              </h2>
              <div
                id="collapseOne"
                class="accordion-collapse collapse"
                aria-labelledby="headingOne"
                data-bs-parent="#accordionExample"
                style=""
              >
                <div class="accordion-body">{children}</div>
              </div>
            </div>
          </div>
        </div>
      ))}
    </>
  );
}

export default ViewResource;
